import React from 'react';
import { IonHeader, IonToolbar, IonTitle, IonContent, IonList, IonItem } from '@ionic/react';
import '../../theme/variables.css'

import Typed from 'react-typed';

import './index.css';

interface State {
  name: string;
  ip: string;
  mac: string;
  connected: boolean;
}

class Main extends React.Component {
  typed: any;

 componentDidMount() {
  this.typed.start(); //start the typing on load
 }

 componentDidUnmount() {
   this.typed.destroy(); //destroy object on unload
 }

  render() {
    return (
      <IonContent class="main-page">
        <IonContent class="header-content">
          <IonHeader class="main-header">
            <IonToolbar class="main-toolbar">
              <IonTitle class="main-toolbar-title" size="large">Looking for devices</IonTitle>
              <Typed class="triple-dots"
                  typedRef={(typed) => { this.typed = typed; }}
                  strings={['...']}
                  typeSpeed={160}
                  backSpeed={160}
                  backDelay={160}
                  startDelay={160}
                  showCursor={false}
                  loop
                  ></Typed>
            </IonToolbar>
          </IonHeader>
        </IonContent>
        <IonContent class="mid-content">
          <IonList>
            <IonItem>TestItem</IonItem>
          </IonList>
        </IonContent>
      </IonContent>
    );
  };
};


class scanForDevices {
